import React from 'react';

import '../../normalize.scss';
import '../../styles/base.scss';

import Banner from '../../components/features/Header';
import View from "../view/view";
import ComponentComoFunciona from '../../pages/ComoFunciona';

import imgBanner from '../../assets/images/como-funciona-1280.png'

function ComoFunciona() {
  let contentBanner = "Aperte o play e saiba como desafiar, duelar e conquistar"
  return (
    <View public={true}>
      <Banner imagemBanner={imgBanner} text={contentBanner} />
      <ComponentComoFunciona />
    </View>
  )
}

export default ComoFunciona;
